	constructor(props) {
		super(props);

		this.state = { a: 'twinkle', query:''
	 };
	}
	handleInputChange = (event) => {
		this.setState({
			query: event.target.value
		});
	};


	render() {
		return (
			<form>
				<input  onChange={this.handleInputChange} className="searchinput" />
				<p />
			</form>
		);
	}
}

